import React from 'react';
import { Link } from 'react-router-dom';

function HeaderNav() {
  return (
    <nav className="header-nav">
      <Link to="/">Home</Link>
      <Link to="/stats">Stats</Link>
      <Link to="/leaderboard">Leaderboard</Link> {/* New Link for Leaderboard */}
    </nav>
  );
}

export default HeaderNav;
